1. 题目描述
将两个升序链表合并为一个新的升序链表并返回。新链表是通过拼接给定的两个链表的所有节点组成的。 
示例：

输入：1->2->4,   1->3->4
输出：1->1->2->3->4->4

2. 思路
2.1. 链表
基础的链表题目，看代码：
public ListNode mergeTwoLists(ListNode l1, ListNode l2) {
    ListNode now = new ListNode(-1);
    ListNode res = now;
    while (l1 != null && l2 != null) {
        if (l1.val > l2.val) {
            now.next = l2;
            l2 = l2.next;
        } else {
            now.next = l1;
            l1 = l1.next;
        }
        now = now.next;
    }
    now.next = l1 == null ? l2 : l1;
    return res.next;
}

