2.1. 栈+递归(不符合要求)
如果不考虑空间复杂度，则可以利用栈+递归轻松完成反转:
public ListNode reverseKGroup(ListNode head, int k) {
    int ans = k;
    if (head == null) {
        return null;
    }
    Stack stack = new Stack<>();
    ListNode pre = head;
    while (k != 0 && pre != null) {
        stack.add(pre);
        k--;
        pre = pre.next;
    }
    if (k != 0) {
        return head;
    }
    ListNode node = stack.pop();
    ListNode ret = node;
    while (!stack.isEmpty()) {
        node.next = stack.pop();
        node = node.next;
    }
    node.next = reverseKGroup(pre,ans);
    return ret;
}

