1. 题目描述
给你两个二进制字符串，返回它们的和（用二进制表示）。
输入为 非空 字符串且只包含数字 1 和 0。
示例 1:

输入: a = "11", b = "1"
输出: "100"

示例 2:

输入: a = "1010", b = "1011"
输出: "10101"

2. 思路
2.1. 模拟
public String addBinary(String a, String b) {
    StringBuilder sb = new StringBuilder();
    int flag = 0;
    int i = a.length() - 1;
    int j = b.length() - 1;
    while (i >= 0 || j >= 0) {
        int cnt = flag;
        if (i >= 0) {
            cnt += a.charAt(i) == '1' ? 1 : 0;
            i--;
        }
        if (j >= 0) {
            cnt += b.charAt(j) == '1' ? 1 : 0;
            j--;
        }
        sb.append(cnt % 2);
        flag = cnt / 2;
    }
    if (flag != 0) {
        sb.append(flag);
    }
    return sb.reverse().toString();
}

