图中阴影部分为所能勾勒出的最大矩形面积，其面积为 10 个单位。
示例:

输入: [2,1,5,6,2,3]
输出: 10

2. 思路
2.1. 枚举
枚举数组每一个元素，从该元素向左右两边扩展，找到左右两边第一个小于它的数，最后计算面积即可。时间复杂度O(n2)
