    int max = 0;
    for (int i = 0; i 
2.2. 单调栈
枚举思路里，最重要的目的是获得第i个位置左边第一个小于它的位置left和右边第一个小于它的位置right，那么为什么利用单调栈就可以求得这两个位置呢？
首先看我们是怎么维护的单调栈：

如果栈为空或者要入栈的元素i大于栈顶元素，就直接入栈
否则把栈顶元素出栈。

通过这种规则，栈里的元素一定是递增的。
那么，对于要出栈的栈顶元素top：

左边第一个小于它的位置一定是它的下一个元素(也就是把当前栈顶出栈后的新栈顶元素)。
右边第一个小于它的位置是即将入栈的元素i。当然入栈元素i也可能等于栈顶元素top，但这对最终结果是没有影响的，因为i位置求得的结果一定大于top位置求得都结果。

这样我们就能找到栈顶位置的对于枚举的结果了，最后栈可能不是为空，再把栈里的元素依次出栈，计算面积即可。
时间复杂度为O(N)。
public int largestRectangleArea(int[] arr) {
    int n = arr.length;
    //特判
    if (n == 0) {
        return 0;
    }
    int max = 0;
    //建立栈，Java官方推荐的是使用双端队列作为栈来使用
    Deque stack = new LinkedList<>();
    int i = 0;
    while (i  arr[stack.getLast()]) {
            stack.addLast(i++);
        } else {
            //出栈
            int top = stack.pollLast();
            //计算面积时要注意确定好区间的范围
            if (!stack.isEmpty()) {
                max = Math.max(max, arr[top] * (i - stack.getLast() - 1));
            } else {
                max = Math.max(max, arr[top] * i);
            }
        }
    }
    //当栈不为空时，把栈顶元素出栈，进行计算
    while (!stack.isEmpty()) {
        int top = stack.pollLast();
        if (!stack.isEmpty()) {
            max = Math.max(max, arr[top] * (n - 1 - stack.getLast()));
        } else {
            max = Math.max(max, arr[top] * n);
        }
    }
    return max;
}

