对于单词=='hit'==，它的下一个转换可以是=='it'==，=='ht'==和=='hi'==三种情况，我们提前建立所有单词的转换表，例如对于=='hit'==，我们把它加入=='it'==，=='ht'==和=='hi'==三个队列中，然后BFS遍历时查找这三种队列中其他的单词即可。
public int ladderLength(String beginWord, String endWord, List wordList) {
    if (!wordList.contains(endWord)) {
        return 0;
    }

    Map> table = new HashMap<>();
    init(beginWord, wordList, table);
    Set vis = new HashSet<> ();

    Queue> queue = new LinkedList<>();
    queue.add(new Pair<>(beginWord,1));

    while (!queue.isEmpty()) {
        Pair top = queue.poll();
        String str = top.getKey();
        vis.add(str);
        Integer value = top.getValue();
        for (int i = 0; i  list = table.get(newStr);
            for (String next : list) {
                if (next.equals(endWord)) {
                    return value + 1;
                }
                if (!vis.contains(next)) {
                    queue.add(new Pair<>(next, value + 1));
                }
            }
        }
    }
    return 0;
}

