part2/146. LRU缓存机制.html.body:
1. 题目描述
运用你所掌握的数据结构，设计和实现一个  LRU (最近最少使用) 缓存机制。它应该支持以下操作： 获取数据 get 和 写入数据 put 。

获取数据 get(key) - 如果密钥 (key) 存在于缓存中，则获取密钥的值（总是正数），否则返回 -1。
写入数据 put(key, value) - 如果密钥已经存在，则变更其数据值；如果密钥不存在，则插入该组「密钥/数据值」。当缓存容量达到上限时，它应该在写入新数据之前删除最久未使用的数据值，从而为新的数据值留出空间。

进阶:
你是否可以在 O(1) 时间复杂度内完成这两种操作？
2. 思路
2.1. HashMap+LinkedList
get操作如果要达到O(1)的时间复杂度还是比较简单的，只需要通过Map数据结构存储，可以通过查找key在O(1)时间复杂度里找到对应的value。
put操作面临的主要问题是，如果只使用Map数据结构存储，当缓存容量达到上限后，不容易删除最久未使用的数据。如果此时能维护一个类似于优先队列的数据结构，把队列中最久未使用的数据删除就比较容易了。
所以最后采用的是HashMap+LinkedList来存储数据，put操作时，把数据存储到HashMap和LinkedList中，其中LinkedList存储到链表头部，如果要删除最久未使用数据时，则删除链表尾部的数据即可。get操作直接从HashMap中取数据，然后更新链表中对应数据的顺序即可。
class Node {
    int key;
    int value;
    public Node(int key, int value) {
        this.key = key;
        this.value = value;
    }
}
class LRUCache {
    Map map;
    LinkedList list;
    int capacity;
    public LRUCache(int capacity) {
        list = new LinkedList<>();
        map = new HashMap<>();
        this.capacity = capacity;
    }

    public int get(int key) {
        if (!map.containsKey(key)) {
            return -1;
        }
        Node node = map.get(key);
        list.remove(node);
        list.addFirst(node);
        return node.value;
    }

    public void put(int key, int value) {
        if (map.containsKey(key)) {
            Node node = map.get(key);
            list.remove(node);
            node.value = value;
            list.addFirst(node);
        } else {
            if (list.size() >= capacity) {
                map.remove(list.removeLast().key);
            }
            Node node = new Node(key, value);
            map.put(key,node);
            list.addFirst(node);
        }
    }
}

2.2. LinkedHashMap
但是啊，这样写在LeetCode的执行用时还是比较大的...后来知道了，Java中有一个LinkedHashMap的数据结构可以很方便的解决这个问题。LinkedHashMap里面的结点自带一个前驱指针和后继指针，维护了一个链表。
class LRUCache extends LinkedHashMap{
    private int capacity;

    public LRUCache(int capacity) {
        super(capacity, 0.75F, true);
        this.capacity = capacity;
    }

    public int get(int key) {
        return super.getOrDefault(key, -1);
    }

    public void put(int key, int value) {
        super.put(key, value);
    }

    @Override
    protected boolean removeEldestEntry(Map.Entry eldest) {
        return size() > capacity; 
    }
}

2.3. 手写链表+HashMap
最后，还有一个参考了大佬的代码后手写的LRU算法...直接看代码吧
class Node {
    int key;
    int value;
    Node prev, next;

    public Node() {
    }

    public Node(int key, int value) {
        this.key = key;
        this.value = value;
    }
}

class NodeList {
    int size;
    Node head;
    Node tail;

    public NodeList() {
        head = new Node();
        tail = new Node();
        head.next = tail;
        tail.prev = head;
        size = 0;
    }

    public void addFirst(Node node) {
        node.next = head.next;
        node.prev = head;
        head.next.prev = node;
        head.next = node;
        size++;
    }

    public void remove(Node node) {
        Node prev = node.prev;
        Node next = node.next;
        prev.next = next;
        next.prev = prev;
        node.next = null;
        node.prev = null;
        size--;
    }

    public Node removeLast() {
        Node node = tail.prev;
        remove(node);
        return node;
    }
}

class LRUCache {

    Map map;
    NodeList list;
    int capacity;

    public LRUCache(int capacity) {
        this.capacity = capacity;
        map = new HashMap<>();
        list = new NodeList();
    }

    public int get(int key) {
        if (!map.containsKey(key)) {
            return -1;
        }
        Node node = map.get(key);
        list.remove(node);
        list.addFirst(node);
        return node.value;
    }

    public void put(int key, int value) {
        if (map.containsKey(key)) {
            Node node = map.get(key);
            list.remove(node);
            node.value = value;
            list.addFirst(node);
        } else {
            if (list.size >= capacity) {
                map.remove(list.removeLast().key);
            }
            Node node = new Node(key, value);
            list.addFirst(node);
            map.put(key, node);
        }
    }
}

