枚举法的复杂度为O(n2)，枚举了每一种子数组，但我们真的有必要知道每一个子数组吗？
对于第i个位置的数：

如果nums[i]为正数：要知道以i结尾的乘积最大的子数组我们只需要知道以i-1结尾的大于0的乘积最大子数组即可。
如果nums[i]为负数：要知道以i结尾的乘积最大的子数组我们只需要知道以i-1结尾的小于0的乘积最小子数组即可（为什么是小于0的最小子数组，因为负负得正啊，乘以小于0的最小的就是最大的了）。

那么DP关系就推出来了，代码如下：
