            dp[i][1] = Math.min(nums[i], nums[i] * dp[i - 1][1]);
        } else {
            dp[i][0] = Math.max(nums[i], nums[i] * dp[i - 1][1]);
            dp[i][1] = Math.min(nums[i], nums[i] * dp[i - 1][0]);
        }
        //更新max
        max = Math.max(dp[i][0], max);
    }
    return max;
}

