part3/206. 反转链表.html.body:
1. 题目描述
反转一个单链表。
示例:

输入: 1->2->3->4->5->NULL
输出: 5->4->3->2->1->NULL

进阶: 
你可以迭代或递归地反转链表。你能否用两种方法解决这道题？
2. 思路
2.1. 迭代：
public ListNode reverseList(ListNode head) {
    ListNode pre = null;
    ListNode root = head;
    while (root != null) {
        ListNode next = root.next;
        root.next = pre;
        pre = root;
        root = next;
    }
    return pre;
}

2.2. 递归：
private ListNode res;
public ListNode reverseList(ListNode head) {
    reverse(head);
    return res;
}

private ListNode reverse(ListNode head) {
    if(head == null || head.next == null) {
        res = head;
        return head;
    }
    ListNode pre = reverse(head.next);
    head.next = null;
    pre.next = head;
    return head;
}

