2. 思路
2.1. 逻辑运算
利用逻辑运算的短路性质，如果n > 0 && (n += sumNums(n - 1)) > 0这个逻辑运算中，n > 0为false，整个都可以确定为false，就没有必要判断(n += sumNums(n - 1)) > 0，里面的递归也就不会执行了，所以当n == 0时递归就结束了。
public int sumNums(int n) {
    boolean flag = n > 0 && (n += sumNums(n - 1)) > 0;
    return n;
}

